import React from 'react';
// import TextBox from './TextBox';
// import ViewStories from './ViewStories';
import ViewWriteStories from './ViewWriteStories';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './Home';
import NavBar from './NavBar';
import WriteStory from './WriteStory';
import ViewStories from './ViewStories';


function App() {
  return (
    <div>
      {/*
      <ViewStories />
      <TextBox /> */}

      <BrowserRouter>
        <NavBar />
        <Routes>
          <Route path='/' element={<Home />} />

          <Route path='/viewWriteStories-GreenLake' element={<ViewWriteStories artwork="Green-Lake-Stories"/>}>
            <Route path="writeStory" element={<WriteStory artURL="Green-Lake-Stories"/>}/>
            <Route path="viewStory" element={<ViewStories artURL="Green-Lake-Stories"/>}/>

          </Route>

          <Route path='/viewWriteStories-GhibliHouse' element={<ViewWriteStories artwork="Ghibli-House-Stories"/>}>
            <Route path="writeStory" element={<WriteStory artURL="Ghibli-House-Stories"/>}/>
          </Route>

          <Route path='/viewWriteStories-Carosel' element={<ViewWriteStories artwork="Carosel-Stories"/>}>
            <Route path="writeStory" element={<WriteStory artURL="Carosel-Stories"/>}/>
          </Route>

          <Route path='/viewWriteStories-CoolingMist' element={<ViewWriteStories artwork="Cooling-Mist-Stories"/>}>
            <Route path="writeStory" element={<WriteStory artURL="Cooling-Mist-Stories"/>}/>
          </Route>
        </Routes>
      </BrowserRouter>
   </div>
  );
}

export default App;
